Hello community, I hope you are feeling well. I have a doubt with the NPCs. Could you help me to place it so that it is activated only when I click on it? At the moment it is activated when approaching the model, and because there are several models together, they show many messages that do not correspond to the correct model.

export let NPCTalk5: Dialog[] = [
  {
    text: 'Decentraland',
  },
  {
    text: 'Decentraland',
  },
  {
    text: 'Decentraland',
    isEndOfDialog: true
  },


]
export let npc5 = new NPC(
  { position: new Vector3(2.8, 0.05,11.50), 
  rotation: Quaternion.Euler(0, 90, 0) }, 
  'models/c-l1robot1men.glb', 
  () => {
  log('Activated')
  npc5.talk(NPCTalk5)
},
{
  faceUser: true,
  portrait: {
    path: 'images/alice.png',
    height: 256,
    width: 256,
    section: {
      sourceHeight: 512,
      sourceWidth: 512
    },
  },  
})
